// import { createApp } from 'vue'
// import App from './App.vue'

// createApp(App).mount('#app')
import Vue from 'vue'
import App from './App.vue'
import Vuetify  from 'vue'

import 'vuetify/dist/vuetify.min.css'

Vue.useAttrs(Vuetify)

new Vue({
    render: h => h(App),
}).$mount('#app')
